    true,nt"url": null,nt"notes": "_(Abstract):_  Stand-alone and easy to use
    geographic toolkit that allows non-GIS users to relate the renewable energy resource
    (solar and wind) data to other geographic data, such as land use, protected areas,
    elevation, etc.rnrn_(Purpose):_  The Solar and Wind Energy Resource Assessment (SWERA)
    Geospatial Toolkit (GsT) is a map-based software application that can be used for
    decision making and policy analysis in addition to planning for future energy projects.
    The SWERA application utilizes Geographical Information Systems (GIS) to develop
    common scenarios to evaluate potential locations for solar or wind energy plants.rnrn_(Supplemental
    Information):_   The zip file contains the geospatial toolkit executable, Getting
    Started Document, and metadata.rnrn---------------------------------------------------------rnrnThe
    GsT was completely redesigned and re-released in November 2010 to provide a more
    modern, easier-to-use interface with considerably faster analytical querying capabilities.
    The revised version of the Geospatial Toolkit for Honduras is available using the
    following link:  http://www.nrel.gov/international/downloads/gst_honduras.exernrn_NOTE:_
    Please use the provided link to access the most up to date software package and
    data.  The Honduras GsT data were last updated in January 2011.  The attached zip
    file below is an archive and contains the previous version of the geospatial toolkit
    executable that has been replaced.rnrnPlease visit [Geospatial Toolkit](http://en.openei.org/wiki/Geospatial_Toolkit)
    for additional information about the GsT and updates.",nt"license_title": "Other
